import React from "react";
import { Link } from "react-router-dom";
import SearchBar from "./SearchBar";

const NavBar = () => {
  return (
    <nav>
      <div className="NavBar">
        <Link to="/home">
          <h1>Henry Countries!</h1>
        </Link>
      </div>
    </nav>
  );
};

export default NavBar;
